import axios from "axios";

export const getButtons = congress => {
  return axios
    .get("http://127.0.0.1:5000/api/" + congress.toString())
    .then(response => {
      var data = [];
      Object.keys(response.data).forEach(rep => {
        data.push(rep.id.bioguide);
      });
    });
};
